          <!-- 
          <h2
            class="text-2xl font-bold text-[#185dc0]"
            v-if="loginManager.user.role === 'RESIDENT'"
          >
            Edit Profile Resident
          </h2>
          <h2
            class="text-2xl font-bold text-[#185dc0]"
            v-if="loginManager.user.role === 'STAFF'"
          >
            Edit Profile Staff
          </h2> -->
        </div>
        <div class="fixed top-5 left-5 z-50">
          <AlertPopUp
            v-if="editSuccess"
            :titles="'Edit Profile Successful.'"
            message="Success!!"
            styleType="green"
            operate="editSuccessMessage"
            @closePopUp="closePopUp"
          />
          <AlertPopUp
            v-if="firstNameError"
            :titles="'First name can only contain Thai or English letters.'"
            message="Error!!"
            styleType="red"
            operate="firstNameErrorMessage"
            @closePopUp="closePopUp"
          />
          <AlertPopUp
            v-if="lastNameError"
            :titles="'Last name can only contain Thai or English letters.'"
            message="Error!!"
            styleType="red"
            operate="lastNameErrorMessage"
            @closePopUp="closePopUp"
          />
          <AlertPopUp
            v-if="phoneError"
            :titles="'Phone number must have 9–10 digits (hyphens allowed but text not allowed).'"
            message="Error!!"
            styleType="red"
            operate="phoneMessage"
            @closePopUp="closePopUp"
          />
          <AlertPopUp
            v-if="positionError"
            title="Position can only type as text."
            message="Error!!"
            styleType="red"
            operate="positionMessage"
            @closePopUp="closePopUp"
          />

          <AlertPopUp
            v-if="error"
            :titles="'There is a problem. Please try again later.'"
            message="Error!!"
            styleType="red"
            operate="problem"
            @closePopUp="closePopUp"
          />
          <AlertPopUp
            v-if="firstNameRequired"
            :titles="'First name is required.'"
            message="Error!!"
            styleType="red"
            operate="firstNameRequired"
            @closePopUp="closePopUp"
          />

          <AlertPopUp
            v-if="lastNameRequired"
            :titles="'Last name is required.'"
            message="Error!!"
            styleType="red"
            operate="lastNameRequired"
            @closePopUp="closePopUp"
          />

          <AlertPopUp
            v-if="emailRequired"
            :titles="'Email is required.'"
            message="Error!!"
            styleType="red"
            operate="emailRequired"
            @closePopUp="closePopUp"
          />

          <AlertPopUp
            v-if="dormRequired"
            :titles="'Dormitory is required.'"
            message="Error!!"
            styleType="red"
            operate="dormRequired"
            @closePopUp="closePopUp"
          />

          <AlertPopUp
            v-if="roomNumberRequired"
            :titles="'Room number is required.'"
            message="Error!!"
            styleType="red"
            operate="roomNumberRequired"
            @closePopUp="closePopUp"
          />
        </div>
        <EditPersonalInfoProfile
          mode="edit"
          :firstName="firstName"
          :lastName="lastName"
          :email="loginManager.user.email"
          :roomNumber="loginManager.user.roomNumber"
          :dormName="userDormName"
          :lineId="profileManager.currentProfile?.lineId"
          :phoneNumber="profileManager.currentProfile?.phoneNumber"
          :profileImage="profileManager.currentProfile?.profileImage"
          :position="loginManager.user.position"
          :status="loginManager.user.status"
          @cancel="goBackProfilePage"
          @success="showProfileSuccess"
          @error="showProfileError"
          @first-name-error="showFirstNameError"
          @last-name-error="showLastNameError"
          @position-error="showPositionError"
          @phone-error="showPhoneError"
          @first-name-required="showFirstNameRequired"
          @last-name-required="showLastNameRequired"
          @email-required="showEmailRequired"
          @dorm-ID-required="showDormRequired"
          @room-number-required="showRoomNumberRequired"
        ></EditPersonalInfoProfile>
      </main>
    </div>
  </div>

  <Teleport to="body" v-if="showHomePageResident"
    ><HomePageResident
  /></Teleport>
  <Teleport to="body" v-if="returnLogin">
    <LoginPage> </LoginPage>
  </Teleport>
  <Teleport to="body" v-if="showLogoutConfirm"
    ><ConfirmLogout @cancelLogout="returnHomepage"></ConfirmLogout
  ></Teleport>
</template>
